import React from 'react';
import {Link} from 'react-router-dom'
import LinkButton from '../items/LinkButton'

function Home() {
    return (
        <div className="home">
            <h1>Create 2D Quizzes</h1>
            <p>Axis lets you create quizzes that place people on a graph.</p>
            <p>You define what the x- and y-axes represent, and you're in charge of how your questions affect the results.</p>
            <figure className="sample-compass">
                <span className="x"></span>
                <span className="y"></span>
                <span className="point"></span>
                {/* <span className="bg"></span> */}
            </figure>
            <LinkButton url="/create" big="true" label="Get Started"></LinkButton>
        </div>
    )
}

export default Home
